-- on crée une table des villes
DROP TABLE IF EXISTS world_cities;

CREATE TABLE world_cities (
  id SERIAL,
  city VARCHAR(75),
  city_ascii VARCHAR(75),
  lat varchar(25),
  lng varchar(25),
  country VARCHAR(75),
  iso2 varchar(25),
  iso3 varchar(25),
  admin_name varchar(75),
  capital varchar(25),
  population varchar(25),
  id_city varchar(25),
  PRIMARY KEY (id)
);

 